(M01K05H01_c.CLIK_00 = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var self = this;
		
		var halNum = 0;
		var mcClue = self.mcClue;
		var mcText = self.mcText;
		mcText_x = mcText.x;
		
		var mcPos = self.mcPos;
		var maxSlide = 8;
		var maxBtn = 2;
		cDone = false;
		
		self.btn_00.alpha = 0;
		
		for (var i = 0; i < maxBtn; i++) {
			self["btn_0" + i].btn.name = +i;
			self["btn_0" + i].btn.addEventListener("click", clickBtn);
		}
		
		function clickBtn(evt) {
			var tNum = parseInt(evt.currentTarget.name);
			mcClue.alpha = 0;
			if (tNum == 1) { //btn next
				if (halNum < maxSlide - 1) {
					halNum++;
					mcText.gotoAndStop(halNum);
					mcPos.gotoAndStop(halNum);
					TweenLite.set(mcText, {
						x: mcText_x,
						alpha: 1
					});
					TweenLite.from(mcText, 1, {
						x: mcText_x + 40,
						alpha: 0,
						ease: Back.easeOut
					});
		
					TweenLite.to(self.btn_00, 0.5, {
						alpha: 1
					});
					if (halNum >= maxSlide - 1) {
						TweenLite.to(self.btn_01, 0.5, {
							alpha: 0
						});
					}
				}
			} else if (tNum == 0) { //btn back
				if (halNum > 0) {
					halNum--;
					mcText.gotoAndStop(halNum);
					mcPos.gotoAndStop(halNum);
					TweenLite.set(mcText, {
						x: mcText_x,
						alpha: 1
					});
					TweenLite.from(mcText, 1, {
						x: mcText_x - 40,
						alpha: 0,
						ease: Back.easeOut
					});
		
					TweenLite.to(self.btn_01, 0.5, {
						alpha: 1
					});
					if (halNum <= 0) {
						TweenLite.to(self.btn_00, 0.5, {
							alpha: 0
						});
					}
				}
			}
			if (halNum == maxSlide - 1) {
				if (!cDone) {
					console.log("interactive complete");
					//self.next_btn.visible = 1;
					TweenLite.delayedCall(2, gui_shownext);
					//gui_shownext();
					cDone = true;
				}
			}
		
			//console.log(halNum);
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// mc_clue
	this.mcClue = new M01K05H01_c.mc_clue();
	this.mcClue.name = "mcClue";
	this.mcClue.parent = this;
	this.mcClue.setTransform(1123.85,553.55);

	this.timeline.addTween(cjs.Tween.get(this.mcClue).wait(1));

	// mc_btn
	this.btn_00 = new M01K05H01_c.mc_btnnext();
	this.btn_00.name = "btn_00";
	this.btn_00.parent = this;
	this.btn_00.setTransform(165.15,553.55,1,1,0,0,180);

	this.btn_01 = new M01K05H01_c.mc_btnnext();
	this.btn_01.name = "btn_01";
	this.btn_01.parent = this;
	this.btn_01.setTransform(1120.05,553.55);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.btn_01},{t:this.btn_00}]}).wait(1));

	// mc_text
	this.mcPos = new M01K05H01_c.mc_pos();
	this.mcPos.name = "mcPos";
	this.mcPos.parent = this;
	this.mcPos.setTransform(640,539.15);

	this.mcText = new M01K05H01_c.mc_text_00();
	this.mcText.name = "mcText";
	this.mcText.parent = this;
	this.mcText.setTransform(640,298.05);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.mcText},{t:this.mcPos}]}).wait(1));

	// bg
	this.instance = new M01K05H01_c.bmp_M01K08H01_box3();
	this.instance.parent = this;
	this.instance.setTransform(107.3,96.1);

	this.timeline.addTween(cjs.Tween.get(this.instance).wait(1));

}).prototype = getMCSymbolPrototype(M01K05H01_c.CLIK_00, new cjs.Rectangle(107.3,96.1,1068,559), null);


